import React from 'react'
import { BrowserRouter } from 'react-router-dom'
import Header from './components/headers/Header';
import { DataProvider } from './GlobaalState'
export default function App() {
  return (
    <DataProvider>
      <BrowserRouter>
        <div>
          <Header/>
        </div>
      </BrowserRouter>
    </DataProvider>
  );
}
